import "./App.css";
import logo from "./Assets/Images/logo-falcone.jpg";
import scrollSvg from "./Assets/Svg/scroll.svg"

function App() {
  return (
    <>
      <navbar>
        <img src={logo} alt="logo" className="logo-image" />
      </navbar>
      <section>
        <div className="font-roboto hero-image hero-image--mountains hero-flex">
          <div className="hero-title margin-auto">
            Fly high <br /> as fuck!
          </div>
          <div className="hero-scroll">scroll to explore</div>
          <div><img src={scrollSvg} alt="scroll-icon"></img></div>
        </div>
      </section>
      <section>2</section>
      <section>3</section>
      <section>4</section>
    </>
  );
}

export default App;
